interface FirstProps{
    name:string,
    lastname:string,
    onClick: () => void
    children: React.React
}

export const First:React.FC<FirstProps> = ({name, lastname, onClick}) => {
    return(
        <div>
            <h1>{name}</h1>
            <h1>{lastname}</h1>
            <button onClick={onClick}>click</button>

            </div>
    )
}
